webpackJsonp([5380105011770],{1112:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Gatsby Starter - Forty by HTML5 UP",author:"Hunter Chang"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/fotb2011-highlight-1/index.md absPath of file >>> MarkdownRemark",html:'<p><a href="http://play.blog2t.net/files/black-or-white/" target="_blank"><img class="alignnone size-full wp-image-1379" title="HiSlope demo screenshot" src="/content/images/2011/09/hislope-screenshot.png" alt="" width="500" height="280" /></a></p>\n<p>Here\'s one of my highlights from Flash on the Beach 2011 - something that I\'d never seen before, but blew me away with its coolness.</p>\n<p>HiSlope is a realtime video effects framework/library, which allows you to see and experiment with those effects in realtime.  The underlying coding framework sounds interesting, and the final effect is pretty neat.  I have a feeling I\'m going to be messing around with it and picking apart the source code some time soon!</p>\n<p>In the meantime, you can:</p>\n<ul>\n\t<li>Check out the demo here: <a href="http://play.blog2t.net/files/black-or-white/">http://play.blog2t.net/files/black-or-white/</a></li>\n\t<li>View the blog post about that demo here: <a href="http://play.blog2t.net/realtime-as3-face-and-eye-detection-with-michael-jackson/">http://play.blog2t.net/realtime-as3-face-and-eye-detection-with-michael-jackson/</a></li>\n\t<li>And have a look at more posts about HiSlope here: <a href="http://play.blog2t.net/hislope/">http://play.blog2t.net/hislope/</a>.</li>\n</ul>',frontmatter:{title:"FOTB2011 Highlight #1: HiSlope",date:"September 15, 2011",tags:["flash"]}}},pathContext:{}}}});
